import React, { Component } from 'react';

export default class App extends Component {
  state = {
    pokemon: null,
  };

  async componentDidMount() {
    fetch('https://pokeapi.co/api/v2/pokemon/ditto')
      .then((res) => res.json())
      .then(console.log);
  }

  render() {
    return <div>{this.state.pokemon}</div>;
  }
}
